// }

function Language(){
  let {language} = useParams();
  return <div>{language}</div>
}

function App() {
  // const { isLogin } = useSelector((state) => {
  //   return state.frontpage;
  // });

  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Frontpage/>} /> 
        <Route path="/member/language/:language" element={<Language/>}/>

        <Route path="/member" element={
            // <Protected loggedIn={isLogin}>
              <Accountpage />
            // </Protected>
            }
        ></Route>

      </Routes>
    </div>
  );

}

export default App;
